import React from "react";

const Profile = (props) => {
    return (
        <div className="individual-subcontainer">
             <img
                alt={"hi"}
                src={props.img}
                className="images"
            />
            <h3>{props.name}</h3>
            <h3>{props.title}</h3>
        </div>
    )
}
export default Profile;
